    state = {
        services:[
            {
                icon:<FaCocktail/>,
                title:"free cocktails"
            },{
                icon:<FaHiking/>,
                title:"free cocktails"
            },{
                icon:<FaShuttleVan/>,
                title:"free cocktails"
            },{
                icon:<FaBeer/>,
                title:"free cocktails"
            }
        ]
    }
    render() {
        return (
            <div>
                <Title title='services'/>
                
            </div>
        );
    }
}
